import Api from "../../services/api";
import  { Component } from 'react';

export default class Home extends Component {

    state = {};

     componentDidMount(){
        
    Api.get('showProfile').then(
        res =>{
            this.setState({
                userDoctor:res.data
            })
        },
        err =>{
            console.log(">>>>>erro home>>>>>>>>>>>",err);
        }
    )
    };
    
    render() {

        if(this.state.userDoctor){
            return(

                <h1>Hello{this.state.userDoctor.name}</h1>            
            )
        }
        return (
            <div>
             <h2>No logado</h2>
              
            </div>
            
        )
    }
}
